  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for the National
  Bison Range outlines Refuge accomplishments for the 1979 calendar year. The report
  begins with an introduction to the Refuge and describes climate and habitat conditions,
  land acquisition, and system status. Refuge construction and maintenance are also
  described. Habitat management is covered; croplands, grasslands, and forestlands
  are discussed. The wildlife section of the report discusses endangered and threatened
  species, migratory birds, mammals, and big game animals. Interpretation and recreation
  activities are outlined; topics include information and interpretation, recreational
  uses, and law enforcement. Field investigations, cooperative programs, items of
  interest, and safety are discussed. Photographs are attached.\",\n\t\"license_title\":
